import { Route, Routes, useNavigate } from 'react-router-dom';
import Layout from './Layout/Layout';
import HomePage from 'pages/HomePage/HomePage';
import TikTokFollowersPage from 'pages/TikTokFollowersPage/TikTokFollowersPage';
import TikTokLikesPage from 'pages/TikTokLikesPage/TikTokLikesPage';
import TikTokViewsPage from 'pages/TikTokViewsPage/TikTokViewsPage';
import ScrollToTop from './ScrollToTop/ScrollToTop';
import GetStarted from 'pages/GetStarted/GetStartedPage';
import Checkout from 'pages/Checkout/CheckoutPage';
import SelectPost from './SelectPost/SelectPost';

export default function App() {
  const navigate = useNavigate();

  const handleGetStarted = productType => {
    const userData = {}; // результат запроса
    if (productType === 'followers') {
      navigate('/tikTokFollowers/selectPost', { state: { userData } });
    } else if (productType === 'likes') {
      navigate('/tikTokLikes/getStarted', { state: { productType, userData } });
    } else if (productType === 'views') {
      navigate('/tikTokViews/getStarted', { state: { productType, userData } });
    }
  };

  const handleSelectPost = postData => {
    // Переход к checkout
    navigate('/checkout', { state: { postData } });
  };

  return (
    <>
      <ScrollToTop />
      <Routes>
        <Route path="/" element={<Layout />}>
          <Route index element={<HomePage />} />

          {/* TikTok Followers */}
          <Route
            path="tikTokFollowers"
            element={
              <TikTokFollowersPage
                onGetStarted={() => handleGetStarted('followers')}
              />
            }
          />
          <Route
            path="tikTokFollowers/selectPost"
            element={<SelectPost onSelectPost={handleSelectPost} />}
          />
          <Route path="tikTokFollowers/checkout" element={<Checkout />} />

          {/* TikTok Likes */}
          <Route
            path="tikTokLikes"
            element={
              <TikTokLikesPage onGetStarted={() => handleGetStarted('likes')} />
            }
          />
          <Route
            path="tikTokLikes/getStarted"
            element={<GetStarted onNextStep={handleSelectPost} />}
          />
          <Route
            path="tikTokLikes/selectPost"
            element={<SelectPost onSelectPost={handleSelectPost} />}
          />
          <Route path="tikTokLikes/checkout" element={<Checkout />} />

          {/* TikTok Views */}
          <Route
            path="tikTokViews"
            element={
              <TikTokViewsPage onGetStarted={() => handleGetStarted('views')} />
            }
          />
          <Route
            path="tikTokViews/getStarted"
            element={<GetStarted onNextStep={handleSelectPost} />}
          />
          <Route
            path="tikTokViews/selectPost"
            element={<SelectPost onSelectPost={handleSelectPost} />}
          />
          <Route path="tikTokViews/checkout" element={<Checkout />} />
        </Route>
      </Routes>
    </>
  );
}
